import React, {memo} from 'react';
import styled from 'styled-components';

import Title from '../../components/TitleContainer';

const DetailPagesContainer = styled.div`
    width:100%;
    height:auto;

    .contentWrap{
        width:1200px;
        margin:0 auto;
        color:#333333;

        .summaryWrap{
            margin-top:140px;
            width:100%;

            .title{
                height: auto;
                font-size:24px;
                font-weight: 500;
                margin-bottom:20px;
            }

            .formTable{
                width:100%;
                /* display: table; */

                tbody{
                    tr{
                        height: auto;
                        

                        th{
                            padding:20px;
                        }

                    }
                }
            }
        }

        
    }

`;

const DetailPages = memo(() => {
    return (
        <DetailPagesContainer>
        <Title title='취업지원' txt='취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.' />
        <div className='contentWrap'>
            <div className='summaryWrap'>
                <h1 className='title'>정책요약</h1>
                <table className='formTable'>
                    <colgroup>
                        <col style={{width:"12%", backgroundColor:"#f0f5"}}></col>
                        <col style={{width:"38%", backgroundColor:"#ff05"}}></col>
                        <col style={{width:"12%", backgroundColor:"#f0f5"}}></col>
                        <col style={{width:"38%", backgroundColor:"#ff05"}}></col>
                    </colgroup>
                    <tbody>
                        <tr>
                            <th className='row'>정책 번호</th>
                            <td>R2024010218403</td>
                            <th className='row'>정책 분야</th>
                            <td>일자리</td>
                        </tr>
                    </tbody>
                </table>
            </div>
        </div>
        </DetailPagesContainer>
    );
});

export default DetailPages;
